import React from "react";
import { Dimensions } from "react-native";
import styled from "styled-components/native";
import Title from "../../components/Title";
import { AntDesign, FontAwesome, Feather, MaterialIcons } from '@expo/vector-icons';

const { width: WIDTH } = Dimensions.get("window");

const TextBox = styled.Text`
    display: flex;
    align-items: center;
`;
const Text = styled.Text`
    margin-left: 5px;
`;

const SemiTitle = styled.Text`
    font-weight: 600;
    margin-bottom: 5px;
`;
const Container = styled.View`
  padding: 0 20px;
  align-items: center;
  flex-direction: row;
  margin-top: 20px;
`;

const Button = styled.button`
  font-size: 1em;
  margin: 1em;
  padding: 0.25em 1em;
  border: 2px solid palevioletred;
  border-radius: 3px;
`;

const BG = styled.Image`
  margin: 0px 20px;  
  margin-top: 15px;
  border-radius: 10px;
  width: width;
  height: 220px;
  margin-bottom: 10px;
`;

const Athlete_button = styled.View`
    padding: 0 20px;
    margin-bottom: 20px;
`;

export default () => (
    <div>
      <Container>
        <MaterialIcons name="sports" size={24} color="black" />
        <Title title={"종목별 체육관 찾기"} />
      </Container>
      <BG source={'https://www.phsisul.org/File/Download/a13a0a4d7fe11880a27a3cee83f239fd'} />
      <Athlete_button>
        <Button><FontAwesome name="map-marker" size={18} color="black" /><Text>경북 포항시 남구 냉천로 580</Text></Button>
        
      </Athlete_button>
    </div>
    
  );
